script: |
  super -f text -I q9528.spq | sort > q9528.out

inputs:
  - name: q9528.spq
    data: |
      SELECT DISTINCT cor0.col2 + col0 * col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col2 / + cor0.col2 + + col0 / cor0.col2 BETWEEN + cor0.col1 * col2 AND NULL;
  - name: tab1

outputs:
  - name: q9528.out
    data: |
